configure:
  commands:
    end:
      new_state: execute
    interface TwentyFiveGigE1/0/35: "interface TwentyFiveGigE1/0/35\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    no switchport private-vlan association host: "no switchport private-vlan association\
      \ host\r\n"
  prompt: Sup-9600-HA(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Sup-9600-HA(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Sup-9600-HA#
